import { useRouter } from 'next/router'
import Link from 'next/link'
import React from 'react';

// import { Container } from './styles';

const Detail = React.FC = () => {
  const router = useRouter()
  const { user } = router.query

  return (
    <>
      <h1>{user}</h1>
    </>
  );
}

export default Detail;
